import express from "express"
import morgan from "morgan"
import mongoose from "mongoose"
import cors from "cors"
import chalk from "chalk"
import bodyParser from "body-parser"
import passport from "passport"
import path from "path"
import mon from "./config/database"
import userApi from './routes/UserRoute'


const app = express()


//mongoose setup
mongoose.connect(mon.db,{useNewUrlParser:true,useUnifiedTopology:true,useCreateIndex:true}).then(()=>{
    console.log(chalk.bold.bgGreen("data base sucessfully connected"))
}).catch((err)=>{
    console.log(chalk.red("failed to connect database :"+err))
})


//Defining middlewares
app.use(morgan('tiny'))
app.use(express.static(path.join(__dirname,'public')))
app.use(cors())
app.use(bodyParser.json())
app.use(bodyParser.urlencoded({extended:true}))
app.use(passport.initialize())
app.use(passport.session())
app.use('/api/user',userApi)





const PORT = process.env.PORT||3000
app.listen(PORT,()=>{
    console.log(chalk.bold.blue(`APP IS RUNNING ON PORT ${PORT}`))
})

