//     next();
// };

app.use(checkUserType);




//user route
app.use('/api/users', users);

//admin route
app.use('/api/admin', admin);


app.listen(PORT, () => {
    console.log(chalk.bold.bgMagenta(`Server started on port ${PORT}`));
});

